import React from 'react';
import GitHubIcon from '@material-ui/icons/GitHub';

const Leftnavbar=()=>{

    return(
        <React.Fragment>
            <div className='leftbar'>
                <ul>
                    <li>Facebook</li>
                    <li>linkedin</li>
                    <li>instagram</li>
                    <li>social media</li>
                    <li></li>
                    
                    
                </ul>
            </div>
            

        </React.Fragment>
    )

};

export default Leftnavbar;
